"""

@author: zenithude

Is Subsequence

Given a string s and a string t, check if s is subsequence of t.

A subsequence of a string is a new string which is formed from the original
string by deleting some (can be none) of the characters without disturbing
the relative positions of the remaining characters. (ie, "ace" is a
subsequence of "abcde" while "aec" is not).

Follow up: If there are lots of incoming S, say S1, S2, ... , Sk where k >=
1B, and you want to check one by one to see if T has its subsequence. In
this scenario, how would you change your code?

Credits: Special thanks to @pbrother for adding this problem and creating
all test cases.

Example 1:

Input: s = "abc", t = "ahbgdc"
Output: true

Example 2:

Input: s = "axc", t = "ahbgdc"
Output: false

Constraints:

    0 <= s.length <= 100
    0 <= t.length <= 10^4
    Both strings consists only of lowercase characters.
"""


class Solution(object):
    """Object to test."""
    def isSubsequence(self, s, t):
        """

        :param s: str
        :param t: str
        :return: bool
        """
        # base case
        if not s:
            return True
        if not t and not s:
            return True
        if not t:
            return False

        res = ''
        j = 0
        for car in t:
            if car == s[j]:
                res += car
                j += 1
            if len(res) == len(s):
                break
        return s == res


s1 = "leeeeetcode"
s2 = ""
s = 'aec'
t = 'abcdec'
obj = Solution()
print(obj.isSubsequence(s, t))
print(obj.isSubsequence(s1, s2))